import * as React from 'react';
import { ClimbingBoxLoader } from 'react-spinners';

const Loader = props => {
  return (
    <div className="Loader">
      <ClimbingBoxLoader size={75} color={'#007fff'} {...props} />
    </div>
  );
};

export default Loader;
